import React, { Component } from 'react'

class MovieItem extends Component {
  constructor (props) {
    super(props)
  }

  componentDidMount () {
    const { movie_record } = this.props
    this.setState({
      postItem: movie_record
    })
  }

  render () {
    return (
      <p>{this.props.movie_record}</p>
    )
  }
}

export default MovieItem
